/*Table structure for table `company` */

DROP TABLE IF EXISTS `company`;

CREATE TABLE `company` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `create_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_check` int(11) DEFAULT '1' COMMENT '更新验证',
  `update_date` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `log_user` varchar(50) DEFAULT NULL COMMENT '记录操作人',
  `name` varchar(50) DEFAULT NULL COMMENT '公司名称',
  `corporate_representative` varchar(255) DEFAULT NULL COMMENT '法人',
  `contact_person` varchar(30) DEFAULT NULL COMMENT '联系人',
  `telephone` varchar(30) DEFAULT NULL COMMENT '电话',
  `contact_dept` varchar(50) DEFAULT NULL COMMENT '联系部门',
  `fax` varchar(30) DEFAULT NULL COMMENT '传真',
  `email` varchar(30) DEFAULT NULL COMMENT '电邮',
  `address` varchar(255) DEFAULT NULL COMMENT '公司地址',
  `introduction` varchar(2000) DEFAULT NULL,
  `organization_code` varchar(50) DEFAULT NULL COMMENT '组织机构代码',
  `commercial_code` varchar(50) DEFAULT NULL COMMENT '工商登记号码',
  `tax_code` varchar(50) DEFAULT NULL COMMENT '税务登记证号',
  `social_security_code` varchar(50) DEFAULT NULL COMMENT '社保登记证号',
  `web_site_id` varchar(50) DEFAULT NULL COMMENT '网站ID',
  `lao_wang_code` varchar(50) DEFAULT NULL COMMENT '市劳网号',
  `scale` varchar(50) DEFAULT NULL,
  `nature` varchar(50) DEFAULT NULL COMMENT '单位性质',
  `economy_type` varchar(50) DEFAULT NULL COMMENT '经济类型',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `view_count` int(11) DEFAULT '0' COMMENT '公司被浏览次数',
  `check_status` varchar(50) DEFAULT NULL COMMENT '是否通过审核予以显示, 默认为0-不显示, 但为方便测试, 暂时写定位1-显示',
  `uid` int(10) DEFAULT NULL COMMENT '用户表外键',
  `acode` varchar(10) DEFAULT NULL COMMENT '所在地区外键',
  `bid` int(10) DEFAULT NULL COMMENT '所属行业外键',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=110 DEFAULT CHARSET=utf8;

/*Data for the table `company` */

/*Table structure for table `education_background` */

DROP TABLE IF EXISTS `education_background`;

CREATE TABLE `education_background` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `create_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_check` int(11) DEFAULT '1' COMMENT '更新验证',
  `update_date` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `log_user` varchar(50) DEFAULT NULL COMMENT '记录操作人',
  `time` varchar(50) DEFAULT NULL COMMENT '时间段',
  `school` varchar(255) DEFAULT NULL COMMENT '学校',
  `major` varchar(255) DEFAULT NULL COMMENT '专业',
  `education` varchar(255) DEFAULT NULL COMMENT '学历',
  `certificate` varchar(255) DEFAULT NULL COMMENT '所获得的证书',
  `rid` int(10) DEFAULT NULL COMMENT '属于哪个简历的id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

/*Data for the table `education_background` */

/*Table structure for table `family_member` */

DROP TABLE IF EXISTS `family_member`;

CREATE TABLE `family_member` (
  `ID` int(10) NOT NULL AUTO_INCREMENT,
  `RELATION` varchar(20) DEFAULT NULL COMMENT '关系',
  `NAME` varchar(50) DEFAULT NULL COMMENT '姓名',
  `AGE` int(3) DEFAULT NULL COMMENT '年龄',
  `UNIT` varchar(255) DEFAULT NULL COMMENT '所在单位',
  `POSITION` varchar(255) DEFAULT NULL COMMENT '职务',
  `PHONE` varchar(50) DEFAULT NULL COMMENT '联系电话',
  `RID` int(10) DEFAULT NULL COMMENT '属于哪个简历',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

/*Data for the table `family_member` */

/*Table structure for table `job` */

DROP TABLE IF EXISTS `job`;

CREATE TABLE `job` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `create_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_check` int(11) DEFAULT '1' COMMENT '更新验证',
  `update_date` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `log_user` varchar(50) DEFAULT NULL COMMENT '记录操作人',
  `name` varchar(50) DEFAULT NULL COMMENT '职位名称',
  `hire_number` int(5) DEFAULT NULL COMMENT '招聘人数',
  `salary` varchar(30) DEFAULT NULL COMMENT '薪资范围',
  `education` varchar(50) DEFAULT NULL COMMENT '最低学历',
  `experience` varchar(50) DEFAULT NULL COMMENT '要求的工作经验年限',
  `gender` varchar(10) DEFAULT NULL COMMENT '性别',
  `description` varchar(1000) DEFAULT NULL COMMENT '岗位描述',
  `provide_benefit` varchar(1000) DEFAULT NULL COMMENT '工资及其他福利',
  `contact_person` varchar(50) DEFAULT NULL COMMENT '联系人',
  `contact_tel` varchar(50) DEFAULT NULL COMMENT '联系电话',
  `contact_email` varchar(50) DEFAULT NULL COMMENT '联系邮箱',
  `view_count` int(10) DEFAULT '0' COMMENT '被浏览次数',
  `nature` varchar(50) DEFAULT NULL COMMENT '职位性质',
  `effective_time` timestamp NULL DEFAULT NULL COMMENT '岗位有效日期截至',
  `work_place` varchar(50) DEFAULT NULL COMMENT '工作地',
  `bed` tinyint(1) DEFAULT NULL COMMENT '是否提供住宿',
  `lunch` tinyint(1) DEFAULT NULL COMMENT '是否提供工作餐',
  `check_status` varchar(50) DEFAULT NULL COMMENT '是否显示/是否通过审核',
  `mark` varchar(50) DEFAULT NULL,
  `cid` int(11) DEFAULT NULL,
  `acode` varchar(10) DEFAULT NULL COMMENT '地区表外键',
  `jccode` varchar(10) DEFAULT NULL COMMENT '职位种类表外键',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=265 DEFAULT CHARSET=utf8;

/*Data for the table `job` */

