/*Table structure for table `record` */

DROP TABLE IF EXISTS `record`;

CREATE TABLE `record` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `create_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_check` int(11) DEFAULT '1' COMMENT '更新验证',
  `update_date` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `log_user` varchar(50) DEFAULT NULL COMMENT '记录操作人',
  `rid` int(11) DEFAULT NULL COMMENT '简历ID',
  `rtitle` varchar(50) DEFAULT NULL COMMENT '简历名称',
  `rname` varchar(50) DEFAULT NULL COMMENT '求职人姓名',
  `rgender` varchar(2) DEFAULT NULL COMMENT '性别',
  `rdisabilitycategory` varchar(50) DEFAULT NULL COMMENT '残疾类别',
  `rage` int(3) DEFAULT NULL COMMENT '年龄',
  `reducation` varchar(50) DEFAULT NULL COMMENT '学历',
  `rmajor` varchar(50) DEFAULT NULL COMMENT '专业',
  `rschool` varchar(255) DEFAULT NULL COMMENT '毕业院校',
  `uid` int(10) DEFAULT NULL COMMENT '个人ID',
  `jid` int(11) DEFAULT NULL COMMENT '职位ID',
  `jname` varchar(255) DEFAULT NULL COMMENT '职位名称',
  `jsalary` varchar(50) DEFAULT NULL COMMENT '职位提供的薪水',
  `jdescription` varchar(500) DEFAULT NULL COMMENT '职位描述',
  `jcontacttel` varchar(50) DEFAULT NULL COMMENT '职位联系方式',
  `jcontactperson` varchar(50) DEFAULT NULL COMMENT '职位联系人',
  `jnature` varchar(50) DEFAULT NULL COMMENT '工作性质',
  `cid` int(10) DEFAULT NULL COMMENT '公司ID',
  `direction` tinyint(1) DEFAULT NULL COMMENT '投递方向标示符, true-简历投像职位, false-公司发送某职位的邀请到简历, 必填项, 任何增删改的操作都不得缺少!!!!!!!,默认为true',
  `comment` varchar(1000) DEFAULT NULL COMMENT '发送邀请说的话/求职留下的话',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=126 DEFAULT CHARSET=utf8;

/*Data for the table `record` */

/*Table structure for table `resume` */

DROP TABLE IF EXISTS `resume`;

CREATE TABLE `resume` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `create_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_check` int(11) DEFAULT '1' COMMENT '更新验证',
  `update_date` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `log_user` varchar(50) DEFAULT NULL COMMENT '记录操作人',
  `title` varchar(50) DEFAULT NULL COMMENT '标题',
  `name` varchar(50) DEFAULT NULL COMMENT '简历名称',
  `gender` varchar(2) DEFAULT NULL COMMENT '性别',
  `birth` varchar(50) DEFAULT NULL COMMENT '生日',
  `identity_card` varchar(20) DEFAULT NULL COMMENT '身份证',
  `race` varchar(20) DEFAULT NULL COMMENT '民族',
  `marriage` varchar(20) DEFAULT NULL COMMENT '婚否',
  `hukou` varchar(50) DEFAULT NULL COMMENT '户口所在地',
  `hukou_address` varchar(255) DEFAULT NULL COMMENT '户籍地址',
  `hukou_status` varchar(50) DEFAULT NULL COMMENT '户口状况',
  `address` varchar(255) DEFAULT NULL COMMENT '居住地地址',
  `zipcode` varchar(6) DEFAULT NULL COMMENT '邮编',
  `phone` varchar(50) DEFAULT NULL COMMENT '电话',
  `email` varchar(50) DEFAULT NULL COMMENT '电子邮箱',
  `qq` varchar(20) DEFAULT NULL COMMENT 'QQ',
  `disability_category` varchar(50) DEFAULT NULL COMMENT '残疾类别',
  `disability_card` varchar(50) DEFAULT NULL COMMENT '残疾证号',
  `disability_level` varchar(50) DEFAULT NULL COMMENT '残疾级别',
  `disability_part` varchar(50) DEFAULT NULL COMMENT '残疾部位',
  `work_ability` varchar(20) DEFAULT NULL COMMENT '有无劳动能力',
  `home_town` varchar(50) DEFAULT NULL COMMENT '籍贯',
  `political_status` varchar(50) DEFAULT NULL COMMENT '政治面貌',
  `age` int(3) DEFAULT NULL COMMENT '年龄',
  `height` float DEFAULT NULL COMMENT '身高',
  `weight` float DEFAULT NULL COMMENT '体重',
  `education` varchar(50) DEFAULT NULL COMMENT '学历',
  `major` varchar(50) DEFAULT NULL COMMENT '专业',
  `school` varchar(50) DEFAULT NULL COMMENT '毕业学校',
  `zhi_cheng` varchar(255) DEFAULT NULL COMMENT '专业职称',
  `shi_ye_hao` varchar(50) DEFAULT NULL COMMENT '就业失业登记证 号',
  `experts` varchar(255) DEFAULT NULL COMMENT '特长',
  `training` varchar(255) DEFAULT NULL COMMENT '培训情况',
  `experience` varchar(20) DEFAULT NULL COMMENT '工作经验年限',
  `work_experience` varchar(2000) DEFAULT NULL COMMENT '工作经历',
  `self_evaluation` varchar(255) DEFAULT NULL COMMENT '自我评价',
  `attachment` blob COMMENT '简历附件',
  `job_nature` varchar(50) DEFAULT NULL COMMENT '工作性质',
  `desire_job` varchar(50) DEFAULT NULL COMMENT '期望职位',
  `desire_address` varchar(50) DEFAULT NULL COMMENT '期望工作地点',
  `desire_salary` varchar(50) DEFAULT NULL COMMENT '期望工资',
  `provide_food_and_room` tinyint(1) DEFAULT '0' COMMENT '是否提供食宿',
  `provide_room` tinyint(1) DEFAULT '0' COMMENT '是否提供住宿',
  `provide_food` tinyint(1) DEFAULT '0' COMMENT '是否提供工作餐',
  `provide_insurance` tinyint(1) DEFAULT '0' COMMENT '是否提供保险',
  `provide_other` varchar(255) DEFAULT NULL COMMENT '其他',
  `work_shift` tinyint(1) DEFAULT '0' COMMENT '是否可以倒班',
  `state` varchar(50) DEFAULT NULL COMMENT '目前状态',
  `is_default` tinyint(1) DEFAULT '0' COMMENT '是否是默认被选中优先投递的简历,1-表示默认选中',
  `check_status` varchar(50) DEFAULT NULL COMMENT '是否显示/是否通过审核',
  `view_count` int(10) DEFAULT '0' COMMENT '被浏览次数',
  `career_test` varchar(255) DEFAULT NULL COMMENT '职业测评情况',
  `process_state` varchar(255) DEFAULT NULL COMMENT '办理情况',
  `uid` int(10) DEFAULT NULL COMMENT '个人用户ID',
  `acode` varchar(10) DEFAULT NULL COMMENT '简历所属地区外键',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=850 DEFAULT CHARSET=utf8;

